    under Schedule H2 Direct Candidate Support on 05/04/2010 utilizing 100% of federal
    funds for said support.  Under Schedule B the Committee reported the  contribution
    to a federal candidate in the amount of $500.00. It is our hope that this will
    clarify the informaiton regarding the activities noted on the Schedule H2.\n"
